import { Link } from "react-router-dom";

export default function Diet()
{
    const userId=localStorage.getItem('userId');

    return (
        <div>
            <p><Link to={"/id/"+userId+"/diet/breakfast"}>아침</Link></p>
            <p>점심</p>
            <p>저녁</p>
        </div>
    );
}
